@vjpai, actually it is a bit tricky to synchronize the threads to avoid this situation (i believe even our own sync server doesn't get this quite right :)). So Yang said he would run some qps benchmarks to see if this introduces any regression there.


We already talked about this offline but for the benefit of others:
The microbechmarks numbers here on this issue are somewhat misleading. The code replaces an atomic store with atomic CAS (potenitally more than 1 cas in case of contention but most commonly just one CAS) and hence the atomic_cas numbers go up. It doesn't necessarily mean we are regressing some core metrics we care about (like cpu usage or throughput/latency numbers for some qps-benchmark tests)
